import { Link, useParams, useLocation } from "react-router-dom";
import "../../index.css"
import Assignments from "../../Assignments";

function CourseNavigation() {
    const links = ["Home", "Modules", "Piazza", "Zoom Meetings", "Assignments",
                   "Quizzes", "Grades", "People", "Pantop Video", "Announcements"];
    const { courseId } = useParams();
    const { pathname } = useLocation();
    return (
        <div className="list-group position-fixed wd-sidebar-padding" style={{width: 150}}>
            {links.map((link, index) => (
                <Link
                    key={index}
                    className={`nav-link ${pathname.includes(link) ? "active" : ""}`}
                    to={`/Kanbas/${courseId}/${link}`}> {link}
                </Link>
            ))}
        </div>
    );
}
export default CourseNavigation;
